  if rec.x_studio_start_date and rec.x_studio_end_date:
    str_from = datetime.datetime.strptime(datetime.datetime.strftime(rec.x_studio_start_date,"%Y-%m-%d"),"%Y-%m-%d")
    str_to = datetime.datetime.strptime(datetime.datetime.strftime(rec.x_studio_end_date,"%Y-%m-%d"),"%Y-%m-%d")
    rec['x_studio_service_period'] = (str_to - str_from).days

